import "./App.css";
import logo from "./logo.svg";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./components/routes/home/Home";
import React from 'react'

function App() {
	return (
		<Router>
      <Routes>
			<div className="App">
				<Route path="/home" element={<Home />}/>
			</div>
        </Routes>
		</Router>
	);
}

export default App;
